#include<iostream>
#include<string>
using namespace std;
long long int sumDigi(string p)
{
	int l=p.size();
	long long int sum=0;
	for(int i=0;i<l;i++)
	{
		sum+=p[i]-'0';
	}
	return sum;
	
}
